import classes from "./NavBar.module.css"

const NavBar = () =>{
    return(
        <div className={classes.header}>
            <div className={classes.logo}>
                <h2>LOGO</h2>
                <h1>SEMICOLON</h1>
            </div>
        </div>
    )
};

export default NavBar;
